def sub(s):
    mx_length = 0
    length = len(s)
    for i in range(length):
        for n in range(i+1, length):
            if len(set(s[i:n])) == len(s[i:n]):
                mx_length = max(mx_length, len(s[i:n]))
    return mx_length

